import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import Main from './components/MainComponent';

class App extends React.Component {
  render(){
    return(
      <div className="App">
        <BrowserRouter>
          <div className="App">
            <Main />
          </div>
        </BrowserRouter>
      </div>
    )
  }
}

export default App;
